// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./IPRegistry.sol";
import "./LicenseRegistry.sol";

contract DisputeModule {
    IPRegistry public ipRegistry;
    LicenseRegistry public licenseRegistry;

    struct Dispute {
        bytes32 ipId;
        bytes32 licenseId;
        address complainant;
        string reason;
        uint256 timestamp;
        bool resolved;
    }

    mapping(bytes32 => Dispute) public disputes;
    mapping(address => bytes32[]) public userDisputes;

    event DisputeCreated(bytes32 indexed disputeId, bytes32 indexed ipId, bytes32 indexed licenseId, address complainant);
    event DisputeResolved(bytes32 indexed disputeId, bool resolved);

    constructor(address _ipRegistry, address _licenseRegistry) {
        ipRegistry = IPRegistry(_ipRegistry);
        licenseRegistry = LicenseRegistry(_licenseRegistry);
    }

    function createDispute(
        bytes32 ipId,
        bytes32 licenseId,
        string memory reason
    ) external returns (bytes32) {
        bytes32 disputeId = keccak256(abi.encodePacked(ipId, licenseId, msg.sender, block.timestamp));
        
        disputes[disputeId] = Dispute({
            ipId: ipId,
            licenseId: licenseId,
            complainant: msg.sender,
            reason: reason,
            timestamp: block.timestamp,
            resolved: false
        });

        userDisputes[msg.sender].push(disputeId);
        
        emit DisputeCreated(disputeId, ipId, licenseId, msg.sender);
        return disputeId;
    }

    function resolveDispute(bytes32 disputeId, bool resolved) external {
        require(ipRegistry.getIP(disputes[disputeId].ipId).owner == msg.sender, "Not IP owner");
        disputes[disputeId].resolved = resolved;
        emit DisputeResolved(disputeId, resolved);
    }

    function getDispute(bytes32 disputeId) external view returns (Dispute memory) {
        return disputes[disputeId];
    }

    function getUserDisputes(address user) external view returns (bytes32[] memory) {
        return userDisputes[user];
    }
}

