// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract IPRegistry {
    struct IP {
        address owner;
        string metadata;
        uint256 timestamp;
    }

    mapping(bytes32 => IP) public ipAssets;
    mapping(address => bytes32[]) public ownerIPs;

    event IPRegistered(bytes32 indexed ipId, address indexed owner, string metadata);

    function registerIP(string memory metadata) external returns (bytes32) {
        bytes32 ipId = keccak256(abi.encodePacked(msg.sender, block.timestamp, metadata));
        
        ipAssets[ipId] = IP({
            owner: msg.sender,
            metadata: metadata,
            timestamp: block.timestamp
        });

        ownerIPs[msg.sender].push(ipId);
        
        emit IPRegistered(ipId, msg.sender, metadata);
        return ipId;
    }

    function getIP(bytes32 ipId) external view returns (IP memory) {
        return ipAssets[ipId];
    }

    function getOwnerIPs(address owner) external view returns (bytes32[] memory) {
        return ownerIPs[owner];
    }
}

contracts/LicenseRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./IPRegistry.sol";

contract LicenseRegistry {
    IPRegistry public ipRegistry;

    struct License {
        bytes32 ipId;
        address licensor;
        address licensee;
        uint256 startTime;
        uint256 endTime;
        string terms;
    }

    mapping(bytes32 => License) public licenses;
    mapping(address => bytes32[]) public licenseeLicenses;
    mapping(address => bytes32[]) public licensorLicenses;

    event LicenseCreated(bytes32 indexed licenseId, bytes32 indexed ipId, address licensor, address licensee);

    constructor(address _ipRegistry) {
        ipRegistry = IPRegistry(_ipRegistry);
    }

    function createLicense(
        bytes32 ipId,
        address licensee,
        uint256 duration,
        string memory terms
    ) external returns (bytes32) {
        require(ipRegistry.getIP(ipId).owner == msg.sender, "Not IP owner");
        
        bytes32 licenseId = keccak256(abi.encodePacked(ipId, msg.sender, licensee, block.timestamp));
        
        licenses[licenseId] = License({
            ipId: ipId,
            licensor: msg.sender,
            licensee: licensee,
            startTime: block.timestamp,
            endTime: block.timestamp + duration,
            terms: terms
        });

        licenseeLicenses[licensee].push(licenseId);
        licensorLicenses[msg.sender].push(licenseId);
        
        emit LicenseCreated(licenseId, ipId, msg.sender, licensee);
        return licenseId;
    }

    function getLicense(bytes32 licenseId) external view returns (License memory) {
        return licenses[licenseId];
    }

    function getLicenseeLicenses(address licensee) external view returns (bytes32[] memory) {
        return licenseeLicenses[licensee];
    }

    function getLicensorLicenses(address licensor) external view returns (bytes32[] memory) {
        return licensorLicenses[licensor];
    }
}

